import React, { useState } from 'react';
import Dummy from './Dummy'

function Home() {
    const [count, setCount] = useState(0);
    const increment = () => {
        setCount((c) => c + 1)
    }
    return (
        <div>
            <div>This is Home page.</div>
            <Dummy/>
            {count}
            <button onClick={() => increment()}>Increment</button>
        </div>
    )
}

export default Home;
